import styles from "../styles/styles";
import products from "../data/products.json";
import Basket
    from "./basket";
export default function Basketlist() {
    return (
        <>
            {products.map((product, index) => (

                <Basket basket={basket} index={index} />


                ))}
        </>

    );
}
